    render(){
        return(
            <section style={{overflow:'hidden'}}className="hero is-danger">
                <div  style={{marginTop:520,height:600,overflow:'hidden'}} className="hero-body">
                    <p className="title">
                    miTinerary
                    </p>
                    <p className="subtitle">
                    Travel off the beaten path
                    </p>
                    <Buttons setAlgo={this.props.setAlgo}/>
                </div>
            </section>

        )
    }
}

export default Homepage
